Solution s = new Solution();
Console.WriteLine(s.PossibleStringCount("", 1971));

public class Solution
{
    public int PossibleStringCount(string word, int k)
    {

        int mod = 1_000_000_007;
        List<int> RunLengths = new List<int>();
        char prev = word[0];
        int count = 1;

        long totalPerms = 1;
        for (int i = 1; i < word.Length; i++)
        {
            if (prev == word[i])
            {
                count++;
            }
            else
            {
                prev = word[i];
                RunLengths.Add(count);
                totalPerms = (totalPerms * count)%mod;
                count = 1;
            }
        }
        RunLengths.Add(count);
        totalPerms = (totalPerms * count)%mod;


        int n = RunLengths.Count;

        int[] curr = new int[k];
        int[] next = new int[k];
        int[] prefix = new int[k + 1];

        for (int j=0; j < k; j++)
        {
            next[j] = 1;
            prefix[j +1] = (prefix[j] + next[j]) % mod; 
        }
        

        for (int i = n - 1; i >= 0; i--)
        {
            curr = new int[k];
            for(int j = k -1 ; j >= 0; j--)
            {

                int l = j + 1;
                int r = j + RunLengths[i];
                if (r >= k) r = k - 1;

                if (l <= r)
                {
                    curr[j] = (prefix[r + 1] - prefix[l] + mod) % mod;
                }
               
            }
            for (int j = 0; j < k; j++)
            {
                prefix[j + 1] = (prefix[j] + curr[j]) % mod;
            }
            var temp = curr;
            curr = next;
            next = temp;
        }
        

        int invalid = next[0];
        
        return (int)((totalPerms - invalid + mod) % mod);

        
    }
}